DIVO - this is an unusual, bright and dynamic arcade game, in which we manage the cavy in a cyber wheel! Our hero must for limited time to reach the finish point is at the level of that simultaneously avoiding collisions with enemies and collecting all sorts of bonuses, for the successful completion of levels! The game also has various elements of puzzles where we have to find certain items in order to pass this or that obstacle. Levels represent as a large tower (tower rotation depends on the movement the main character) around which are placed all the game elements: platforms, teleporters, traps, etc.


